  <title>

  <style>
   body {
            display: flex;
            justify-content: center;
            align-items: center;
            height: 100vh;
            margin: 0;
            background-color: #d3d3d3;
        }
        .collage {
            display: grid;
            grid-template-columns: repeat(6, 1fr);
            gap: 5px;
            width: 80%;
            max-width: 1200px;
            transform: rotate(-10deg);
        }
        .collage img {
            width: 100%;
            height: auto;
        }
        .satellite {
            position: absolute;
            top: 50%;
            right: 10%;
            transform: translateY(-50%);
            width: 100px;
        }
  </style>
